            var isDraggable = $(document).width() > 768 ? true : false;

            function initialize() {
                geocoder = new google.maps.Geocoder();

                var mapOptions = {
                    zoom: 8,
                    disableDefaultUI: false,
                    scrollwheel: false,
                    panControl: true,
                    scaleControl: true,
